import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import reportWebVitals from './reportWebVitals';
import {BrowserRouter} from 'react-router-dom';

function Home() {
  return (
    <div>
      <h2>Home</h2>
      Home....
    </div>
  )
}

function Topics() {
  return (
    <div>
      <h2>Topics</h2>
      Topics....
    </div>
  )
}

function Contact() {
  return (
    <div>
      <h2>Contact</h2>
      Contact....
    </div>
  )
}

function App(){
  return (
    <div>
      <h1>React Router DOM example</h1>
      <Home></Home>
      <Topics></Topics>
      <Contact></Contact>
    </div>
  )
}

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);

